import React,{Component} from 'react';
import  './App.css'
class Timer extends Component{

    constructor(props){
        super(props);
            this.state={
                 clock:0
            }
        
    }


    render(){
      //  console.log(this.props.start)
        return (
            <div >
            <p>You have been on this site since:</p><br />
            <span>{this.state.clock}</span>
            <p>Sec</p>
            </div>
        );
    }
}

export default Timer;
